description:
This is 18 original songs and two covers (Daniel Johnston and Kitten Forever) that were recorded between February and August of 2007 in Indiana, PA and College Station, TX. Guest vocals by Jammypants on a couple of the songs.

Lots of synthesizers and drum machines, several guitar solos. 


